import { AppBarStyle } from "../utils/styles";
export const AppBar = () => {
  return (
    <AppBarStyle>
      <p >Configuring</p>
      <img
       src='https://cdn.discordapp.com/icons/947715289104150599/fcbc3da59538aed4b71d712cdfaac4c5.webp?size=128' 
      height={45} width={45}
      style={{
        
          borderRadius: '50%' 
          
      }} 
      alt='logo'/>
    </AppBarStyle>
  );
};
